import React from 'react';
import { Link } from 'react-router-dom';

const Disciplina = () => {
  return (
     <div> 
    <header>
        <div id="menu">
            <div id="esquerda"><Link to="/" style={{color: "white"}}>Home</Link></div>     
            <div id="direita"><Link to="/aluno" style={{color: "white"}}>Aluno</Link></div>
        </div>
    </header>

<section>

<div id="form">
    <form method="post">
    <label>Disciplina</label>
      <input className="input-text" placeholder="Disciplina" type="text" name="disciplina"/>
      <label>Professor</label>
      <input className="input-text" placeholder="Professor" type="text" name="professor"/>
      <button className="input-btn">Cadastrar</button>
      </form>
      </div>
</section>
    </div>
    );
}

export default Disciplina;
